// src/components/EventList.js
// src/EventList.js
import React from 'react';
import Event from './Event';

const EventList = ({ events }) => {
  return (
    <div className="event-list">
      {events.map((event, index) => (
        <Event
          key={index}
          title={event.title}
          date={event.date}
          description={event.description}
          image={event.image}
          video={event.video}
        />
      ))}
    </div>
  );
};

export default EventList;
